// And groups predicates with the AND operator between them.
func And(predicates ...predicate.AILog) predicate.AILog {
	return predicate.AILog(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.AILog) predicate.AILog {
	return predicate.AILog(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.AILog) predicate.AILog {
	return predicate.AILog(sql.NotPredicates(p))
}
